import React from 'react';
import {
  Box, Typography, TextField, Button, Table, TableHead, TableBody,
  TableRow, TableCell, Paper, TableContainer
} from '@mui/material';

const FormComponent4 = ({
  title, subjectsData, setSubjectsData, name, setName, soName, setSoName,
  idLabel, rollNumber, setRollNumber, semester, setSemester,
  course, setCourse, department, setDepartment, year, setYear,
  sgpa, setSgpa
}) => {

  const handleAddSubject = () => {
    setSubjectsData([...subjectsData, {
      title: '', credits: '', maxIA: '', maxSE: '',
      marksIA: '', marksSE: '', percentage: '', grade: '',
      gradepoint: '', creditpoints: '', result: ''
    }]);
  };

  const handleSubjectChange = (index, field, value) => {
    const updated = [...subjectsData];
    updated[index][field] = value;
    setSubjectsData(updated);
  };

  return (
    <Box sx={{ pt: 9, px: 6, pb: 7 }}>
      <Typography variant="h6" gutterBottom>{title}</Typography>

      <Box sx={{ mb: 3, display: 'flex', flexDirection: 'column', gap: 2 }}>
        <TextField label="Name" value={name} onChange={(e) => setName(e.target.value)} />
        <TextField label="S/o or D/o" value={soName} onChange={(e) => setSoName(e.target.value)} />
        <TextField label={idLabel || "Student ID"} value={rollNumber} onChange={(e) => setRollNumber(e.target.value)} />
        <TextField label="Course" value={course} onChange={(e) => setCourse(e.target.value)} />
        <TextField label="Department" value={department} onChange={(e) => setDepartment(e.target.value)} />
        <TextField label="Semester" value={semester} onChange={(e) => setSemester(e.target.value)} />
        <TextField label="Year of Study" value={year} onChange={(e) => setYear(e.target.value)} />
        <TextField label="SGPA" value={sgpa} onChange={(e) => setSgpa(e.target.value)} />
        <Button variant="contained" onClick={handleAddSubject}>➕ Add Subject</Button>
      </Box>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow sx={{ backgroundColor: '#dddddd' }}>
              <TableCell>S.No.</TableCell>
              <TableCell>Subject Code & Title</TableCell>
              <TableCell>Credits (C)</TableCell>
              <TableCell>Max Marks (I.A / S.E)</TableCell>
              <TableCell>Marks Secured (I.A / S.E)</TableCell>
              <TableCell>Total %</TableCell>
              <TableCell>Grade</TableCell>
              <TableCell>Grade Point (G)</TableCell>
              <TableCell>Credit Points (C×G)</TableCell>
              <TableCell>Result</TableCell>
            </TableRow>
